import FooterCss from "./footer.module.css";

function Footer() {
  return (
    <>
      <div className={FooterCss.container}>
        <div className={FooterCss.box}>
            <ul>
                <li>Questions? Contact us.</li>
            </ul>
        </div>
        <div className={FooterCss.box}></div>
        <div className={FooterCss.box}></div>
        <div className={FooterCss.box}></div>
      </div>
    </>
  );
}

export default Footer;
